script:
  code: |
    def main(ctx, metadata):
      # è§„åˆ™åˆ—è¡¨å®šä¹‰(è§„åˆ™å:ä»£ç†è§„åˆ™), ä¾¿äºè°ƒæ•´å¤„ç†é¡ºåº
      ruleList = {
        "direct-classical":"DIRECT",
        "proxy-classical":"DEBUG",
        "reject-classical":"REJECT",
        "advertising":"REJECT",
        "reject":"REJECT",
        "proxy":"PROXY",
        "telegramcidr":"PROXY",
        "applications":"DIRECT",
        "private":"DIRECT",
        "icloud":"DIRECT",
        "apple":"DIRECT",
        "google":"DIRECT",
        "direct":"DIRECT",
        "lancidr":"DIRECT",
        "cncidr":"DIRECT"
      }

      # è§£æhost->ipèµ‹å€¼åˆ°metadataä¸­ ç”¨äºåç»­åˆ¤æ–­
      ip = ctx.resolve_ip(metadata["host"])
      if ip == "":
        return "DIRECT"

      metadata["dst_ip"] = ip

      # éå†è§„åˆ™ç­–ç•¥, æœ‰å‘½ä¸­å³è¿”å›
      for rule,policy in ruleList.items():
        if ctx.rule_providers[rule].match(metadata):
          ctx.log("[match] {host} matched rule [{rule}] use {policy}".format(host=metadata["host"],rule=rule,policy=policy))
          return policy

      # åˆ¤æ–­ipæ˜¯å¦å±€åŸŸç½‘ä»¥åŠä¸­å›½, æ˜¯åˆ™ç›´è¿
      code = ctx.geoip(ip)
      # ctx.log('[geoip] {host} {ip} {code}'.format(host=metadata["host"],ip=ip,code=code))
      if code == "LAN" or code == "CN":
        return "DIRECT"

      # æ¼ç½‘ä¹‹é±¼èµ°ä»£ç†
      return "PROXY"
